(function(){document.querySelectorAll(".btn-delete").forEach(e=>{document.querySelectorAll(".btn-delete").length,e.onclick=()=>{Swal.fire({title:"Are you sure?",text:"You want to remove from wishlist",icon:"warning",showCancelButton:!0,confirmButtonColor:"#3085d6",cancelButtonColor:"#d33",confirmButtonText:"Remove"}).then(t=>{t.isConfirmed&&(Swal.fire("Removed","Item removed from wishlist.","success"),e.parentElement.parentElement.parentElement.parentElement.remove(),document.querySelectorAll(".btn-delete").length)})}})})();
